import React from 'react';
import AccountList from './AccountList';

const AccountShowList = () => {
    return (
        <main>
            <AccountList
                accounts={[
                    {
                        username: 'francis',
                        total_games: 11,
                        total_wins: 8,
                        total_kills: 32
                    }
                ]}
            />
        </main>
    )
}

export default AccountShowList;
